import java.util.*;

public class Solution {
    public int maximumLength(int[] toys, int t) {
        int numToys = toys.length;
        int[][] dp = new int[numToys][t + 1];
        for (int i = 0; i < numToys; i++) {
            Arrays.fill(dp[i], 1);
        }

        int maxLength = 1;
        int[] maxLengthEndingWithT = new int[t + 1];
        Arrays.fill(maxLengthEndingWithT, -1);

        List<Map<Integer, Integer>> valueMaxLengthMap = new ArrayList<>();
        for (int i = 0; i <= t; i++) {
            valueMaxLengthMap.add(new HashMap<>());
        }

        for (int i = 0; i < numToys; i++) {
            for (int j = 0; j <= t; j++) {
                for (int l = 0; l < j; l++) {
                    dp[i][j] = Math.max(dp[i][j], 1 + maxLengthEndingWithT[l]);
                }
                if (valueMaxLengthMap.get(j).containsKey(toys[i])) {
                    dp[i][j] = Math.max(dp[i][j], 1 + valueMaxLengthMap.get(j).get(toys[i]));
                }
                maxLength = Math.max(maxLength, dp[i][j]);
            }
            for (int j = 0; j <= t; j++) {
                maxLengthEndingWithT[j] = Math.max(maxLengthEndingWithT[j], dp[i][j]);
                valueMaxLengthMap.get(j).put(toys[i], Math.max(valueMaxLengthMap.get(j).getOrDefault(toys[i], 0), dp[i][j]));
            }
        }
        return maxLength;
    }


}
